import './App.css';
import { VerticalResizer } from './components/VerticalResizer';

function App() {

  return (
    <div id="App">

      {/*Header bar on top of the screen*/}
      <div id="headerBar">

        <div id="logo"></div>

        <div id="dropdown-containers"></div>
      </div>


      {/*Containing the code editor and the output panel*/}
      <div id="workspace">

        <div id="editor"></div>

        <div id="outputPanel">
          <VerticalResizer />
          <div id="output"></div>
        </div>

      </div>

    </div>
  );
}

export default App;
